import React from "react";
// import classes from "./Categories.module.scss"
// import Calc from "./Calc"
import CategoriesItem from "./CategoriesItem";


const CategoriesList = () => {
    // const {categoryName, item, href} = props
    return(
        <>
            <CategoriesItem 
                categoryName={"Action"}
                calc={"Calc+"}
                item={"Item"}
                href={"#"}
                to={"/books/action"}
            />
            <CategoriesItem 
                categoryName={"Adventure"}
                calc={"Calc+"}
                item={"Item"}
                href={"#"}
                to={"/books/adventure"}
            />
            <CategoriesItem 
                categoryName={"Comedy"}
                calc={"Calc+"}
                item={"Item"}
                href={"#"}
                to={"/books/comedy"}
            />
            <CategoriesItem 
                categoryName={"Drama"}
                calc={"Calc+"}
                item={"Item"}
                href={"#"}
                to={"/books/drama"}
            />
            <CategoriesItem 
                categoryName={"Romance"}
                calc={"Calc+"}
                item={"Item"}
                href={"#"}
                to={"/books/romance"}
            />
            <CategoriesItem 
                categoryName={"Sports"}
                calc={"Calc+"}
                item={"Item"}
                href={"#"}
                to={"/books/sports"}
            />
        </>                
    )
}

export default CategoriesList;
